import React, { Component } from 'react'

export default class Event extends Component {
    render() {
        const { event } = this.props;
        return (
            <div>
                <h2>{event.title}</h2>
                <p>{event.eventDate}</p>
                <p>{event.eventType}</p>
                <p>{event.created}</p>
            </div>
        )
    }
}
